import air from '../../images/air.PNG';
import ecommerce from '../../images/ecommerce.JPG';
import portofolio from '../../images/portofolio.PNG';
import restaurant from '../../images/restaurant.JPG';
import shop from '../../images/shop.PNG';


export const osfProject = {
    title: 'E-commerce',
    description: 'A full e-commerce website using HTML5,CSS3 and JS',
    githubLink: 'https://github.com/madalinamart/restaurant',
    projectLink : 'https://osf-madalina-martiniuc.netlify.app/',
    img: restaurant,
    alt: 'osf project screenshot'
}

export const projectOne = {
    title: 'Restaurant',
    description: 'Home page of a restaurant menu using HTML5,CSS3 and JS',
    githubLink: 'https://github.com/madalinamart/restaurant',
    projectLink : 'https://madalina-restaurant.netlify.app',
    img: restaurant,
    alt: 'restaurant project screenshot'
}

export const projectTwo = {
    title: 'Airplane',
    description: 'Home page of an airplane company using HTML5,CSS3 and JS',
    githubLink: 'https://github.com/madalinamart/air',
    projectLink : 'https://airproject.netlify.app',
    img: air,
    alt: 'air project screenshot'
}

export const projectThree = {
    title: 'Portofolio v1',
    description: 'My first portofolio using HTML5,CSS3 and JS',
    githubLink: 'https://github.com/madalinamart/portofolio',
    projectLink : 'https://madalinamartiniuc.netlify.app',
    img: portofolio,
    alt: 'portofolio project screenshot'
}

export const projectFour = {
    title: 'E-commerce',
    description: 'Full stack project using HTML5,CSS3,JS, PHP, mySQL',
    githubLink: 'https://github.com/madalinamart/products-project',
    /* projectLink : 'https://madalinamartiniuc.netlify.app', */
    img: ecommerce,
    alt: 'products project screenshot'
}

export const projectFive = {
    title: 'Shop',
    description: 'Shop project using HTML5,CSS3,JS',
    githubLink: 'https://github.com/madalinamart/shop',
    projectLink : 'https://shoppage.netlify.app',
    img: shop,
    alt: 'products project screenshot'
}
